import React from 'react';

class Menu extends React.Component {
    render() {
        return (
            <ul>
                <li><a href="#">Menu</a></li>
                <li><a href="#">Documents</a></li>
                <li><a href="#">Search</a></li>
                <li><a href="#">Messages</a></li>
                <li><a href="#">Statistics</a></li>
                <li><a href="#">Settings</a></li>
            </ul>
        );
    }
}

export default Menu;
